using namespace std;

void print(vector<int>ans){
    for(int i=0;i<ans.size();i++){
        cout<<ans[i]<<" ";
    }
    cout<<endl;
}

//TLE solution
class Solution1 {
public:
    vector<int> getMaximumXor(vector<int>& nums, int maximumBit) {
        int limit = pow(2,maximumBit);
        int n=nums.size();
        int store[n];
        store[0]=nums[0];
        for(int i=1;i<n;i++){
            store[i] = store[i-1]^nums[i];
        }
        
        vector<int>ans(n);
        for(int i=n-1;i>=0;i--){  
            int local = INT_MIN;
            int index;
            for(int j=0;j<limit;j++){
                if((store[i]^j) > local){
                    local = store[i]^j;
                    ans[n-1-i] = j;
                }
            }
            //ans[i] = local;
           // cout<<index<<endl;
        }
        
        print(ans);
        return ans;
    }
};

//basic idea is that a^b=c then a^c=b
//here a be the xor of array elements and c be pow(2,maximumBit)-1
//c is the target always to reach by xoring a with b
//so if we xor a with c itself we get b
class Solution {
public:
    vector<int> getMaximumXor(vector<int>& nums, int maximumBit) {
        int n=nums.size();
        int limit = (1<<maximumBit)-1;
        int total=0;
        for(int x:nums){
            total = total^x;
        }
        vector<int>ans(n);
        ans[0] = total^limit;
        for(int i=1;i<n;i++){
            total=total^nums[n-i];
            ans[i] = total^limit;
        }
        print(ans);
        return ans;
    }
};

